import React, {Component} from 'react';

class App extends Component {
  manejador = () =>{
    alert()
  }
  render () {
    return (
      <div>
        <button
          onMouseDown={this.manejador}
        >
          Dispara
        </button>
      </div>
    )
  }
}

export default App;
